function NavBar(){
    return(
        <div>
        <ul>
            <li>
                <link to="/home">Home</link>
            </li>
            <li>
                <link to="/about">About</link>
            </li>
            <li>
                <link to="/contact">Contact</link>
            </li>
            <li>
                <link to="/product">product</link>
            </li>
        </ul>
        </div>
    );
};
export default NavBar;
